import { Component } from '@angular/core';

@Component({
  selector: 'app-turnos',
  templateUrl: './turnos.component.html',
  styleUrls: ['./turnos.component.css']
})
export class TurnosComponent {

}
<nav>
    <ul class="btn btn-primary w-100 h-50">
       <a class="btn btn-primary" routerLink="/">Home</a>
       <a class="btn btn-primary" routerLink="/servicios">Servicios</a>
       <a class="btn btn-primary" routerLink="/acceso">Acceso</a>
       <a class="btn btn-primary" routerLink="/profesionales">Profesionales</a>
       <a class="btn btn-success" routerLink="/turnos">Turnos</a>
       <a routerLink="/" style="width: 200px; margin-left: 60%;"> 
        <img routerLink="/" style="width: 12%;" src="https://images2.imgbox.com/72/8b/ic4qD3n9_o.jpg" alt="">
       </a>


    </ul>
</nav>
